import { Box, Center, CardHeader, Grid, GridItem, Stack, Image, Card, CardBody, Heading, Text, CardFooter, Button, Code } from '@chakra-ui/react';
import './App.css';
import AboutMe from './components/AboutMe';
import Testimonials from './components/Testimonials';

function App() {
  return (
    <Grid
      templateAreas={`"header header"
                  "main aboutMeIMG"
                  "testimonials testimonials"
                  "footer footer"`}
      gridTemplateRows={'80px 750px 650px 100px'}
      gridTemplateColumns={'900px 1fr'}
      h='200px'
      gap='1'
      color='blackAlpha.700'

    >
      <GridItem pl='2' bg='blue.300' area={'header'}>
        Header
      </GridItem>
      <GridItem pl='2' bg='blue.900' area={'aboutMeIMG'}>
        <Text className='scale-font' align="center" fontSize="150px" color="white"> About me </Text>
      </GridItem>
      <AboutMe />
      <Testimonials />
      <GridItem pl='2' bg='blue.900' area={'footer'}>
        Footer
      </GridItem>
    </Grid>)

}

export default App;
